import './App.css';
import ExpenseItem from './Components/ExpenseItem';

function App() {
  const expense=[
    {
      title:"car Insurance",
      price:24.15,
      date: new Date(2021, 3, 23),
    },
    {
      title:"paper Insurance",
      price:60.15,
      date:new Date (2020, 4, 3),
    }
  ]
  return (
    <div className="expenses">
      <ExpenseItem title={expense[0].title}
      price={expense[0].price}
      date={expense[0].date}/>
     <ExpenseItem title={expense[1].title}
      price={expense[1].price}
      date={expense[1].date}/> 
    </div>
  );
}

export default App;
